Governor Newsom announced that several large, national banks and close to 200-state chartered banks, credit unions, and servicers have signed on to the State’s proposal to provide financial relief to California consumers. Under the proposal, consumers affected by the COVID-19 crisis may contact their financial institution to request the following types of relief:
• Residential Mortgage Payments:  Forbearances of up to 90 days, consistent with applicable guidelines, with streamlined application and approval processes;
• Credit Reporting:  No reporting of derogatory tradelines (e.g., late payments) to credit reporting agencies, consistent with applicable guidelines, for borrowers;
• Foreclosures and Evictions: Moratorium on initiation of foreclosure sales or evictions, consistent with applicable guidelines, for at least 60 days; and
• Fee Relief: Waiver or refund or mortgage-related fees and other fees, including CD withdrawals (subject to federal law) for at least 90 days.

The NYDFS issued guidance urging all regulated student loan servicers to take reasonable and prudent actions to help borrowers affected by COVID-19. In addition to swiftly implementing the relief available under the CARES Act for all borrowers whose student loans are federally owned, regulated student loan servicers should respond to the COVID-19 emergency by, at a minimum and among other things:
• For at least 90 days, providing forbearance or similar repayment accommodation for all private loan borrowers affected by COVID-19; reporting missed payment subject to repayment accommodation as “current” to credit reporting agencies; refraining from sending accounts to third-party debt collectors or proceeding with collections actions; and waiving late payment fees for forbearances and other repayment accommodation;
• Reducing wherever possible administrative procedures, document verification, or recertification requirements for enrolling a borrower in an income-driven repayment plan, deferment, forbearance, rehabilitation, consolidation, or equivalent relief;
• Posting, processing, and crediting student loan payments in a timely manner, and ensuring borrowers are held harmless for any delay; and
• Proactively contacting borrowers about available relief if the borrower has been impacted by COVID-19.

The FDIC published a notice of a proposed rulemaking that would mitigate the deposit insurance assessment effects of participating in the SBA’s Paycheck Protection Program (PPP) and the Federal Reserve’s Paycheck Protection Program Lending Facility (PPPLF) and Money Market Mutual Fund Liquidity Facility (MMLF). The FDIC seeks to mitigate the deposit insurance assessment effects of participating in the PPP, PPPLF, and MMLF so that participating insured depository institutions (IDIs) would not be subject to increased deposit insurance assessments. Specifically the proposed rule would:
1) remove the effect of participation in the PPP and PPPLF on various risk measures used to calculate an IDI's assessment rate; 
2) remove the effect of participation in the PPPLF and MMLF programs on certain adjustments to an IDI’s assessment rate;
3) provide an offset to an IDI’s assessment for the increase to its assessment base attributable to participation in the MMLF and PPPLF; and 
4) remove the effect of participation in the PPPLF and MMLF programs when classifying IDIs as small, large, or highly complex for assessment purposes.
The FDIC is proposing an effective date of no later than 30-June-2020 and an application date of 1-April-2020, which would ensure that the changes are applied to assessments starting in the second quarter of 2020. Comments on the proposed rule will be accepted for seven days after publication in the Federal Register.

The FHFA extended several loan origination flexibilities currently offered by Fannie Mae and Freddie Mac until at least 30-June-2020, including:
• alternative appraisals on purchase and rate term refinance loans; 
• alternative methods for verifying employment before loan closing; 
• flexibility for borrowers to provide documentation to allow renovation disbursements; and 
• expanding the use of power of attorney and remote online notarizations to assist with loan closings.
